import React from "react";
import "./App.css";
import Header from "./components/header";
import Booklist from "./components/booklist";
import AddBook from "./components/addbookform";

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      modalOn: false
    };
  }

  example = () => {
    this.state.modalOn = true;
  };

  render() {
    return <AddBook />;
  }
}

export default App;
